import React from "react";
import Tile from "./Tile";

const Board = ({ board }) => {
  return (
    <div className="board">
      {board.map((row, rIndex) =>
        row.map((value, cIndex) => (
          <Tile key={`${rIndex}-${cIndex}`} value={value} />
        ))
      )}
    </div>
  );
};

export default Board;
